function show(element) {
  const lightbox = document.getElementById("lightbox");
  const image = document.getElementById("image");
  image.src = element.src; // Set the source of the lightbox image to the clicked image
  lightbox.style.display = "flex"; // Show the lightbox
}

// Close the lightbox when clicking on it
document.getElementById("lightbox").addEventListener("click", function () {
  this.style.display = "none"; // Hide the lightbox
});

Array.from(button).forEach(function (buttons) {
  buttons.addEventListener("click", function () {
    let d = document.createElement("div");
    d.classList.add("myclass");
    d.style.color = "red";
    d.style.width = "300px";
    d.style.height = "300px";

    // d.style.backgroundColor = "yellow";
    main_addtocart.appendChild(d);
    // Find the closest card_main (or a container) that holds both the button and the image
    let card = buttons.closest(".card_main");

    if (card) {
      // Find the image within this specific card
      let image = card.querySelector("img");

      // Log or apply effects only on this specific image
      if (image) {
        console.log(image.src);

        alert("product is added to cart");
        let x = document.createElement("img");
        x.src = image.src;
        d.appendChild(x);

        let text = document.createElement("p");
        text.textContent = "price:20$";
        d.appendChild(text);
        let buybutton = document.createElement("button");
        buttontext = document.createElement("p");
        buttontext.textContent = "Buy Now";
        buybutton.appendChild(buttontext);
        d.appendChild(buybutton);
      }
    }
  });
});
addtocardimg.addEventListener("click", () => {
  if (main_addtocart.style.display === "none") {
    main_addtocart.style.opacity = "1";
    main_addtocart.style.display = "flex";
  } else {
    main_addtocart.style.opacity = "0.5";

    main_addtocart.style.display = "none";
  }
});
